async function userUpdateCrea(skinOwner:Array<String>, token:String | undefined) {
    var data: any = []
    const response = await fetch("http://localhost:4000/users/updateMe", {
        method: "PATCH",
        body: JSON.stringify({ "skinOwner" : skinOwner}),
        headers: { "Content-Type": "application/json", "authorization" : "Bearer " + token}
    });
    data = [await response.json(), await response.status];
    return data
}

export default userUpdateCrea;
